$tmx['hp_edit_test']='اس فارم میں آپ کو ٹیسٹ، ترمیم یا ٹیسٹ حذف کر سکتے ہیں. ایک ٹیسٹ داخل کرنے کے لئے آپ کو پہلے سے ہی ایک سوال اور جوابات کے ساتھ کم سے کم ایک موضوع کی وضاحت کرنا ہوگی. کافی حقوق اور ایک درست IP پتے کے ساتھ صرف صارف صرف ٹیسٹ انجام دے سکتے ہیں. فیلڈ آئی پی میں بھی مختلف آئی پی پتوں کی ایک فہرست بھی شامل ہوسکتی ہے جس میں امتحان انجام دینے کے حقدار ہیں. ایک آئی پی ایڈریس میں جنگلی کارڈ (* = کوئی نمبر) بھی شامل ہوسکتا ہے. ٹیسٹ صرف مخصوص وقت کے فریم کے دوران فعال ہو جائے گا اور ایک بار شروع ہو جائے گا، اسے مخصوص زیادہ سے زیادہ وقت میں مکمل کرنا ہوگا. ٹیسٹ میں مختلف قسم کے سوالات کے ساتھ کئی موضوعات شامل ہوسکتے ہیں جو بے ترتیب طور پر نکالے جائیں گے. آپ سوالات کی دشواری سطح کے ہر نقطہ کے لئے بنیادی سکور کی وضاحت کرسکتے ہیں. آپ اس امتحان میں ترمیم نہیں کرسکتے جو پہلے ہی انجام دے چکے ہیں. جب ایک ٹیسٹ ختم ہوجاتا ہے تو اس کے تمام لاگ ان (ٹیسٹ کے اعداد و شمار) کو بھی خارج کر دیا جاتا ہے. [پیدا] بٹن آپ کو پی ڈی ایف فارمیٹ میں منفرد ٹیسٹ کے کسی مباحثہ نمبر پیدا کرنے کی اجازت دیتا ہے جو کمپیوٹر کے بغیر پرنٹ اور انجام دیا جا سکتا ہے. موضوعات پر چوکتے ہوئے ساتھیوں کے اندر حروف اور نمبروں کے سوالات کے لئے فوری اعداد و شمار ہیں: [(سوالات کی تعداد) (سوال کی قسم S، M، T، O) (مشکل) :( کم جواب) - (زیادہ سے زیادہ جوابات)].';
